import React from "react"
import { BrowserRouter, Switch , Route} from 'react-router-dom';
import Student from './Components/Student.js'
import Admin from './Components/Admin.js'
import Studenthome from './Components/Studenthome.js';
import Adminhome from './Components/Adminhome.js';
import PublicRoute from './Components/Publicroute.js';
import ResetRoute from './Components/ResetRoute.js';
import StudentRoute from './Components/Studentroute.js';
import AdminRoute from './Components/Adminroute.js';
import Reset from './Components/Reset.js';
import Newstudentreg from './Components/Newstudentreg';
import Errorpage from './Components/Errorpage.js'
class App extends React.Component {


  render() {
    return (
      <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <PublicRoute restricted={true} component={Student} />
        </Route>
        <Route path="/Admin" exact>
          <PublicRoute restricted={true} component={Admin} />
        </Route>
        <Route path="/Studenthome" exact>
          <StudentRoute component={Studenthome} />
        </Route>
        <Route path="/Adminhome" exact>
          <AdminRoute component={Adminhome} />
        </Route>
        <Route path="/Reset" exact>
          <ResetRoute component={Reset} />
        </Route>
        <Route path="/Newstudentreg" exact>
          <AdminRoute component={Newstudentreg} />
        </Route>
        <Route path="/error" exact>
          <PublicRoute restricted={false} component={Errorpage} />
        </Route>
      </Switch>
    </BrowserRouter>
    );
  }
}

export default App;
